import React, { useEffect } from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';

const mapStyles = {
    width: '100%',
    height: '100%'
};

function MapContainer (props) {
    let mapContainer;

    useEffect( ()=> {
        mapContainer = (props)? (
            <Map
                google={props.google}
                zoom={14}
                style={mapStyles}
                initialCenter={
                    {
                        lat: -1.2884,
                        lng: 36.8233
                    }
                }
            />
        ) : null
    }, [props])

        return (
            <div>

            {mapContainer}
            </div>
        );
}

export default GoogleApiWrapper({
    apiKey: process.env.REACT_APP_GOOGLE_API_KEY
})(MapContainer);
